import { Card } from "antd";
import {
  RetweetOutlined,
  HeartOutlined,
  MessageOutlined,
  EllipsisOutlined,
} from "@ant-design";

const PostCard = ({ post }) => {
  return (
    <>
      <div>
        <Card
          cover={post.Image[0] && <PostImages images={post.Images} />}
        ></Card>
      </div>
    </>
  );
};

export default PostCard;
